      { id: 4, message: 'Blabla', likes: 6 }
    ], 

    dialogs: [
      { id: 1, name: 'Luda' },
      { id: 2, name: 'Sasha' },
      { id: 3, name: 'Vika' },
      { id: 4, name: 'Nika' }
    ],

    messages: [
      { id: 1, text: 'Hi' },
      { id: 2, text: 'How are you?' },
      { id: 3, text: 'What is your name?' },
      { id: 4, text: 'What is your favorite color? ' }
    ]
}

export default state;
